// @ts-check
import { initSchema } from '@aws-amplify/datastore';
import { schema } from './schema';



const { ExercisesStorage, User, Exercises, Week, Day } = initSchema(schema);

export {
  ExercisesStorage,
  User,
  Exercises,
  Week,
  Day
};
